import styled from "styled-components";
import palette from "../utils/styles";

const HeaderBorder = styled.div`
  background-color: ${palette.green[5]};
  color: white;
  left: 0;
  right: 0;
  top: 0;
  position: absolute;
  width: 100%;
  display: flex;
`;

const HeaderFont = styled.div`
  font-size: 20px;
  margin: 20px;
  color: white;
`;

const GoYouTube = styled.div`
  font-size: 20px;
  margin: 20px;
  color: white;
  border: 1px solid white;
`;

export { HeaderBorder, HeaderFont, GoYouTube };
